/*

This component has commented out functions to fetch and parse MeSH terms from an XML file and export a list of unique terms.

// `fetchXMLFile`: async function takes a URL as input, fetches the content, and returns it as text.
// `parseNameStrings`: async function fetches XML content using `fetchXMLFile` function, and parses the content using `DOMParser`. It iterates over an array of tag names (`['DescriptorName', 'ConceptName']`) and extracts the text content of the 'String' nodes under each tag name. The result is an object with keys as tag names and values as arrays of text content.

import { useEffect } from "react";
import { DOMParser } from "xmldom";

useEffect(() => {
    async function fetchXMLFile(url) {
        try {
            const response = await fetch(url);
            if (!response.ok) {
                throw new Error(`HTTP error! Status: ${response.status}`);
            }
            const xmlContent = await response.text();
            return xmlContent;
        } catch (error) {
            console.error('Error fetching XML file:', error);
        }
    }
        
    async function parseNameStrings(url) {
        try {
            const xmlContent = await fetchXMLFile(url);
            const domParser = new DOMParser();
            const xmlDoc = domParser.parseFromString(xmlContent, 'application/xml');
            
            const tagNames = ['DescriptorName', 'ConceptName'];
            const result = {};

            tagNames.forEach(tagName => {
                const nodes = xmlDoc.getElementsByTagName(tagName);
                const nameStrings = Array.from(nodes).map(node => {
                    const stringNode = node.getElementsByTagName('String')[0];
                    return stringNode && stringNode.textContent;
                }).filter(nameString => nameString);

                result[tagName] = nameStrings;
            });

            console.log(result);

        } catch (error) {
            console.error('Error parsing XML file:', error);
        }
    }
        
    parseNameStrings('/desc2023.xml');
}, []);

// function to remove duplicates from the parseNameStrings array: 

function removeDuplicates(arr) {
    const uniqueArray = Array.from(new Set(arr));
  
    let formattedOutput = '';
    uniqueArray.forEach((item, index) => {
      formattedOutput += `"${item.trim()}"${index !== uniqueArray.length - 1 ? ',\n' : ''}`;
    });
  
    console.log(formattedOutput);
}
  
removeDuplicates(meshTerms);
*/

